      #lewdierank-filter-menu {
        position: relative;
        display: none;
        width: 90%;
        height: 40px;
        padding: 10px 5%;
        margin: 0 auto 8px 0;       
        flex-flow: row nowrap;
        justify-content: space-between;
        align-items: flex-start;
        overflow: visible;
        z-index: 10;
        gap: 15px;
        font-size: 22px;
      }

      /* Checkboxes */
      .lewdierank-pool-checkbox-container {
        display: block;
        position: relative;
        padding-left: 35px;
        margin-bottom: 12px;
        cursor: pointer;
        font-size: 22px;
        color: var(--lewdierank-bright-pink);
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
      }

      /* Hide the browser's default checkbox */
      .lewdierank-pool-checkbox-container input {
        position: absolute;
        opacity: 0;
        cursor: pointer;
        height: 0;
        width: 0;
      }

      #lewdierank-pool-checkbox-label-text {
        font-size: inherit;
      }

      /* Create a custom checkbox */
      .lewdierank-pool-checkmark {
        position: absolute;
        top: 0;
        left: 0;
        height: 25px;
        width: 25px;
        font-size: inherit;
        background-color: #eee;
      }

      /* On mouse-over, add a grey background color */
      .lewdierank-pool-checkbox-container:hover input ~ .lewdierank-pool-checkmark {
        background-color: #ccc;
      }

      /* When the checkbox is checked, add a pink background */
      .lewdierank-pool-checkbox-container input:checked ~ .lewdierank-pool-checkmark {
        background-color: var(--lewdierank-dark-pink);
      }

      /* Create the checkmark/indicator (hidden when not checked) */
      .lewdierank-pool-checkmark:after {
        content: "";
        position: absolute;
        display: none;
      }

      /* Show the checkmark when checked */
      .lewdierank-pool-checkbox-container input:checked ~ .lewdierank-pool-checkmark:after {
        display: block;
      }

      /* Style the checkmark/indicator */
      .lewdierank-pool-checkbox-container .lewdierank-pool-checkmark:after {
        left: 9px;
        top: 5px;
        width: 5px;
        height: 10px;
        border: solid white;
        border-width: 0 3px 3px 0;
        -webkit-transform: rotate(45deg);
        -ms-transform: rotate(45deg);
        transform: rotate(45deg);
      }

      #lewdierank-page-tabs-bar {

      #lewdierank-page-tabs-container {

      .lewdierank-page-tab {

      #lewdierank-search-div {
        position: relative;
        display: flex;
        flex-flow: row nowrap;
      }

      #lewdierank-search-close-button {
        display: none;
        position: absolute;
        z-index: 2;
        top: 0;

        padding: 8px 10px 0 10px;

        border-left: 1px solid #777;
        color: #333;
        font-size: inherit;

      }

      #lewdierank-search-close-button:hover,

      #lewdierank-search-textbox, #lewdierank-search-button {

      #lewdierank-search-button {

        color: #fff;

        padding: 0 15px;
      }

      #lewdierank-search-button:hover {

      }

      .lewdierank-search-autocomplete-items {
        position: absolute;
        color: var(--lewdierank-bright-pink);
        border: 1px solid #d4d4d4;
        border-bottom: none;
        border-top: none;
        z-index: 99;
        /*position the autocomplete items to be the same width as the container:*/
        top: 100%;
        left: 0;
        right: 0;
      }

      .lewdierank-search-autocomplete-items div {
        padding: 10px;
        cursor: pointer;
        background-color: #fff; 
        border-bottom: 1px solid #d4d4d4; 
      }

      /*when hovering an item:*/
      .lewdierank-search-autocomplete-items div:hover {
        background-color: #e9e9e9; 
      }

      #lewdierank-open-by-id-textbox {
        font-size: inherit;
        text-align: center;
      }

      #lewdierank-open-by-id-div-button {
        font-size: inherit;
      }

      /*when navigating through the items using the arrow keys:*/
      .autocomplete-active {
        background-color: var(--lewdierank-bright-pink) !important; 
        color: #ffffff; 
      }

      /* Hide the spin buttons that browsers add to integer input fields */
      /* Chrome, Safari, Edge, Opera */
      input::-webkit-outer-spin-button,
      input::-webkit-inner-spin-button {
        -webkit-appearance: none;
        margin: 0;
      }

      /* Firefox */
      input[type=number] {
        -moz-appearance: textfield;
      }

      /* Hide the default search icon */
      input[type="search"]::-webkit-search-decoration,
      input[type="search"]::-webkit-search-cancel-button,
      input[type="search"]::-webkit-search-results-button,
      input[type="search"]::-webkit-search-results-decoration {

    <script>
      const poolAddress = 'neftyblocksp';      
      const isTesting = document.location.hash !== document.location.hash.replace("testing=true");
      let ownerResults = [];
      let leaderboardStats = [];

      // API Settings
      let apiFailedAttempts = 0;
      let apiEndpoints = [
        'wax.api.atomicassets.io',
        'aa-api-wax.eosauthority.com',
        'atomic.hivebp.io',
        'wax-atomic-api.eosphere.io',
        'wax.eosusa.io',
        'wax.blokcrafters.io'
        //'atomic.wax.io',
      ];      

      // Choose a random starting endpoint so that all the traffic isn't going to a single endpoint
      // If an API call fails, the index will be increased and the API call will be tried again
      let apiEndpointIndex = Math.floor(Math.random() * apiEndpoints.length);

      // $(document).ready(async function () {
      //   init();
      // });

      // Initialize the content after the document loads
      function init() {
        let includeUnpacked = true;
        let overallRankDisplayStyle = 'display:block;';
        let unpackedRankDisplayStyle = 'display:none;';

        // Create the Lewdie cards
        let lewdieHtml = "";
        database.map((lewdie) => {
           let unpackedClass = " lewdierank-card-unpacked";

           if (lewdie.unpackedRank !== null) {
            // Lewdie has been opened so don't mark it as being unpacked.
            unpackedClass = '';
           }

            const lewdieCard = "<div id='lewdierank-card-" + lewdie.edition + "' class='lewdierank-card" + unpackedClass + "' onclick='showLewdie(" + lewdie.edition + ")'>"
            + "<div class='lewdierank-card-top'>"
            + "<div class='lewdierank-card-overallrank' style='" + overallRankDisplayStyle + "'>#" + lewdie.Rank + "</div>"
            + "<div class='lewdierank-card-unpackedrank' style='" + unpackedRankDisplayStyle + "'>#" + lewdie.unpackedRank + "</div>"
            + "<div class='lewdierank-card-owner'>" + lewdie.owner + "</div>"
            + "</div>"
            + "<img src='https://ipfs.hivebp.io/thumbnail?hash=" + lewdie.image + "' "
            + "alt='" + lewdie.name + "' "
            + "class='lewdierank-card-img' loading='lazy' style='width:100%;'>"
            + "<div class='lewdierank-card-name'>" + lewdie.name + "</div>"
            + "</div>";

            lewdieHtml += lewdieCard;
        });

        // Add the html to the container
        $("#lewdierank-lewdies-container").html(lewdieHtml);

        // Create the Leaderboard
        let leaderCount = 0;
        let leaderboardHtml = "<table id='lewdierank-leaderboard-table'>"
        + "<thead><tr>"
        + "<th>Rank</th>"
        + "<th>Account</th>"
        + "<th>#Lewdies</th>"
        + "<th>Total Score</th>"
        + "</tr></thead>";
        + "<tbody>";

        leaderboardStats.map((leader) => {
           let thisLeaderRank = "N/A";

           if (leader.owner !== poolAddress) {
            leaderCount += 1;
            thisLeaderRank = "#" + leaderCount;
           }

            const leaderRow = "<tr onclick='showAccount(&quot;" + leader.owner + "&quot;);'>"
            + "<td>" + thisLeaderRank + "</td>"
            + "<td>" + leader.owner + "</td>"
            + "<td>" + leader.count + "</td>"
            + "<td>" + leader.score.toFixed(2) + "</td>"
            + "</tr>";

            leaderboardHtml += leaderRow;
        });

        leaderboardHtml +=  "</tbody></table>";

        // Add the html to the container
        $("#lewdierank-leaderboard-container").html(leaderboardHtml);

        // Adjust the font size to fit the screen resolution
        $( window ).resize(function() {
          resizeContent();
        });

        resizeContent();

        // Prevent unwanted events
        // Prevent the modal from closing when the content container is clicked
        $("#lewdierank-modal-content").on('click', function(e){
          e.stopPropagation();
        })

        // Prevent the main document from scrolling when the modal is visible
        $("#lewdierank-modal").on('wheel touchmove', function(e) {
          const modalContent = $('#lewdierank-modal-content');
          const outerHeight = modalContent.outerHeight();
          const scrollHeight = modalContent.get(0).scrollHeight;
          var scrollTop = modalContent.scrollTop();

          if (event.deltaY < 0)
          {
            // Scrolling up
            if(scrollTop === 0) {
              e.preventDefault();
            };
          }
          else if (event.deltaY > 0)
          {
            // Scrolling down
            if(outerHeight + scrollTop >= scrollHeight) {
              e.preventDefault();
            };
          }
        });

        // Window on scroll functions        
        window.onscroll = function() {
          // When the user scrolls down 20px from the top of the document, show the button
          if (document.body.scrollTop > 20 || document.documentElement.scrollTop > 20) {
            $("#return-to-top-button").css("display", "block");
          } else {
            $("#return-to-top-button").css("display", "none");
          }
        };

        // Add filter event triggers
        $('#lewdierank-pool-checkbox').change(function() {
          updatePoolSetting(this.checked); 
        });

        // Reset the filters
        $("#lewdierank-open-by-id-textbox").val("");
        $("#lewdierank-search-textbox").val("");
        $("#lewdierank-pool-checkbox").prop("checked", true);

        // Show the page tabs and filter menu
        $("#lewdierank-page-tabs-bar").css("display", "flex");
        $("#lewdierank-filter-menu").css("display", "flex");

        // Enter key event listener for search by ID
        $('#lewdierank-open-by-id-textbox').keypress(function(event){
          var keycode = (event.keyCode ? event.keyCode : event.which);
          if(keycode == '13'){
            openById();
          }
        });

        // Initialize the autocomplete function on the search input
        autocomplete(document.getElementById("lewdierank-search-textbox"), autocompleteArray);

        // Hide the loading imageUrl
        $("#lewdierank-svg-loading").hide();

        // Load the passed in filters
        loadFilters();
      }

      // Update pool setting
      function updatePoolSetting(includePool = null, doSearch = true) {
        // Get the pool setting from the hash string if it wasn't passed in
        if(includePool === null) {
          // default to true unless otherwise specified in the has string
          includePool = true;
          if (getHashValue("pool") === "false") {
            includePool = false;
          }
        }

        // Show and hide cards as needed
        if(includePool) {
          // Show all of the Lewdies
          $("#lewdierank-pool-checkbox").prop("checked", true);
          $(".lewdierank-card-overallrank").css("display", "block");
          $(".lewdierank-card-unpackedrank").css("display", "none");
          setHash("pool", true);
        }
        else {
          // Show only the Lewdies that have been unpacked
          $(".lewdierank-card-overallrank").css("display", "none");
          $(".lewdierank-card-unpackedrank").css("display", "block");
          setHash("pool", false);
        }

        if (doSearch) {
          performSearch();
        }        
      }

      // Check if the screen size is compact or large, used to determine how to scale things
      function isCompactView() {
        let isCompact = true;
        const cardWidth = $(".lewdierank-card:first").width();

        // If the screen is wide enough to display 5 Lewdies then it's not compact
        if ($(window).width() > (cardWidth ?? 0) * 5) {
          isCompact = false;
        }

        return isCompact;
      }

      // Check if the screen size is extra large
      function isXlView() {
        let isXl = false;
        const cardWidth = $(".lewdierank-card:first").width();

        // If the screen is wide enough to display 7 Lewdies then the screen is extra large
        if ($(window).width() > (cardWidth ?? 0) * 7) {
          isXl = true;
        }

        return isXl;
      }

      function resizeContent() {
        const cardWidth = $(".lewdierank-card:first").width();
        const isCompact = isCompactView();
        const isXl = isXlView();

        $(".lewdierank-card-overallrank").css("fontSize", (cardWidth * .115) + "px");
        $(".lewdierank-card-unpackedrank").css("fontSize", (cardWidth * .115) + "px");
        $(".lewdierank-card-owner").css("fontSize", (cardWidth * .095) + "px");
        $(".lewdierank-card-name").css("fontSize", (cardWidth * .12) + "px");
        $(".lewdierank-pool-checkbox-label-text").css("fontSize", (cardWidth * .095) + "px");
        $("#lewdierank-search-close-button").css("height", ($("#lewdierank-search-textbox").outerHeight() - 8) + "px");

        // Calculate new modal image size
        let newImageSize = $(window).width() * .33;
        let newStatSize = $(window).width() * .4;

        if (isCompact) {
          // Screen size is small so make the image take up most of the width
          newImageSize = $(window).width() * .8;
          newStatSize = $(window).width() * .8;
          $(".lewdierank-pool-checkbox-label-text").html("Pool?");
          $("#lewdierank-modal-content").css("fontSize", (cardWidth * .095) + "px");          
          $("#lewdierank-leaderboard-container").css("fontSize", "18px");
          $("#lewdierank-filter-menu").css("fontSize", "16px");
          $("#lewdierank-filter-menu").css("height", "40px");
          $("#lewdierank-open-by-id-textbox").css("width", "60px");
          $("#lewdierank-open-by-id-textbox").css("padding", "6px 0");
          $("#lewdierank-search-textbox").css("max-width", "22vw");
          $("#lewdierank-search-textbox").css("padding", "6px 8px");
        }
        else {
          $(".lewdierank-pool-checkbox-label-text").html("Include Pool?");
          $("#lewdierank-modal-content").css("fontSize", (cardWidth * .08) + "px");          
          $("#lewdierank-leaderboard-container").css("fontSize", "22px");
          $("#lewdierank-filter-menu").css("fontSize", "22px");
          $("#lewdierank-filter-menu").css("height", "60px");
          $("#lewdierank-open-by-id-textbox").css("width", "100px");
          $("#lewdierank-open-by-id-textbox").css("padding", "8px 0");
          $("#lewdierank-search-textbox").css("max-width", "40vw");
          $("#lewdierank-search-textbox").css("padding", "8px 15px");
        }

        if (isXl) {
          $("#lewdierank-modal-content").css("fontSize", (cardWidth * .11) + "px");
        }

        $("#lewdierank-modal-image-container").css("width", newImageSize + "px");
        $("#lewdierank-modal-image-container").css("height", newImageSize + "px");
        $("#lewdierank-stats-container").css("width", newStatSize + "px");

        // Make card image height equal the card image width
        const cardImageWidth = $(".lewdierank-card-img:visible:first").width();
        if (cardImageWidth > 0) {
          $(".lewdierank-card-img").css("height", cardImageWidth + "px");
        }
      }

      // Scroll to the top of the page
      function returnToTop() {
        document.body.scrollTop = 0;
        document.documentElement.scrollTop = 0;
      }

      // Get the lewdie json object from the database
      function getLewdieById(id) {
        return database.find(item => {
          return item.edition == id;
        })
      }

      function showLewdie(id) {
        // Get the lewdie json object from the database
        const lewdie = getLewdieById(id);

        // Load the modal image
        let imageUrl = '';
        const isCompact = isCompactView();
        const isXl = isXlView();
        //const logoUrl = 'https://ipfs.hivebp.io/ipfs/QmX8jUFBeqzR6zysUV1tqa915uW7A4wQrNGPaSXQYq5ZYH';
        if (isCompact || !isXl) {
          // Load the thumbnail on smaller screens to prevent the user from seeing the image take time to load
          imageUrl = !lewdie.image ? '' : 'https://ipfs.hivebp.io/thumbnail?hash=' + lewdie.image;
        } else {
          // Load the HD image since the thumbnail image will appear blurry on extra large views
          imageUrl = !lewdie.image ? '' : 'https://ipfs.hivebp.io/ipfs/' + lewdie.image;
        }

        $("#lewdierank-modal-image-container").css('background-image', "url('" + imageUrl + "')");

        // Populate the rarity stats
        $("#lewdierank-data-name").html(lewdie.name);

        $("#lewdierank-data-top-percent").html(!lewdie.Rank ? '' : (lewdie.Rank / 555 * 100).toFixed(2) + "%");
        $("#lewdierank-data-total-score1").html(!lewdie.TotalScore ? '' : lewdie.TotalScore.toFixed(2));
        $("#lewdierank-data-total-score2").html(!lewdie.TotalScore ? '' : lewdie.TotalScore.toFixed(2));
        $("#lewdierank-data-background").html(lewdie.background ?? '');
        $("#lewdierank-data-background-percent").html(!lewdie.BG ? '' : (lewdie.BG * 100).toFixed(2) + "%");

        $("#lewdierank-data-neck").html(lewdie.necklace ?? '');

        $("#lewdierank-data-neck-score").html(!lewdie.neckScore ? '' : lewdie.neckScore.toFixed(2));

        $("#lewdierank-data-earrings-score").html(!lewdie.earringScore ? '' : lewdie.earringScore.toFixed(2));

      function removeHash(key) {
        var hashArray = getHashArray();
        var hashString = '';

        // Create the hashString
        for (let i = 0; i < hashArray.length; i++) {
          // Update the passed in key value pair if they already exist
          if (hashArray[i][0] !== key) {
            if (hashString.length > 0) {
              hashString += "&";
            }

            hashString += hashArray[i][0] + "=" + hashArray[i][1];
          }
        }

        // Write the updated hashString to the url
        window.location.hash = "#" + hashString;
      }

      function setHash(key, value) {
        let hashArray = getHashArray();
        let keyFound = false;
        let hashString = '';

        // Create the hashString
        for (let i = 0; i < hashArray.length; i++) {
          // Update the passed in key value pair if they already exist
          if (hashArray[i][0] === key) {
            keyFound = true;
            hashArray[i][0] = key;
            hashArray[i][1] = value;
          }

          if (hashString.length > 0) {
            hashString += "&";
          }

          hashString += hashArray[i][0] + "=" + hashArray[i][1];
        }

        // Write the passed in key value pair to the hashString if it wasn't already included in the hashArray
        if (!keyFound) {
          if (hashString.length > 0) {
            hashString += "&";
          }

          hashString += key + "=" + value;
        }

        // Write the hashString to the url
        window.location.hash = "#" + encodeURI(hashString.toLowerCase());
      }

      function getHashArray() {
        let hashArray = [];
        const anchor = decodeURI(document.location.hash.substring(1));

        if (anchor !== "" && anchor !== anchor.replace("=", "")) {
          hashArray = anchor.split("&").map(function(item) {
            return item.trim();
          });

          for (let i = 0; i < hashArray.length; i++) {
            hashArray[i] = hashArray[i].split("=");
          }
        }

        return hashArray;
      }

      async function getOwners() {
        const apiEndpoint = apiEndpoints[apiEndpointIndex];
        const apiUrl = 'https://' + apiEndpoint + '/atomicassets/v1/assets?template_id=614845&page=1&limit=1000&order=asc&sort=asset_id';

        //console.log("Getting owners from ", apiUrl);

        $.ajax({
          url: apiUrl,
          type: 'GET',
          success: function(res){
            //console.log( "Success! ", res );
            // Save the data to the ownerResults array
            ownerResults = res.data;

            // Create a new array with the merged data
            let merged = [];
            let unpackedCount = 0;
            let previousScore = 0;
            let previousRank = 0;

            // Loop through the database and get the extra info for all of the lewdies
            for (let i = 0; i < database.length; i++) {
              let ownerItem = res.data.find((item) => item.name === database[i].name);

              // Override some values for testing
              // TODO: Remove this testing block after testing is complete
              if (isTesting) {
                if (database[i].name == 'Lewdie-#463') {
                  ownerItem.owner = 'composerhodl';
                }
                if (database[i].name == 'Lewdie-#515') {
                  ownerItem.owner = 'composerhodl';
                }
                if (database[i].name == 'Lewdie-#211') {
                  ownerItem.owner = 'p1cqw.wam';
                }
                if (database[i].name == 'Lewdie-#81') {
                  ownerItem.owner = '1fdau.wam';
                }
                if (database[i].name == 'Lewdie-#275') {
                  ownerItem.owner = 'cqcau.wam';
                }
                if (database[i].name == 'Lewdie-#165') {
                  ownerItem.owner = 'ouqqu.wam';
                }
                if (database[i].name == 'Lewdie-#214') {
                  ownerItem.owner = 'hglqw.wam';
                }
              }

              // Calculate the unpacked rank
              let unpackedRank = null;

              if (ownerItem.owner != poolAddress) {
                unpackedCount += 1;

                // If this item shares the same TotalScore as the previous unpacked item, then they'll share the same rank
                // Otherwise, the rank will be equal to the number of unpacked items
                if (database[i].TotalScore == previousScore) {
                  unpackedRank = previousRank;
                }
                else {
                  unpackedRank = unpackedCount;
                }

                // Set the previous values to be the current values
                previousScore = ownerItem.TotalScore;
                previousRank = unpackedRank;
              }

              // Create the trait string which will be used when a search term is entered into the search box
              let traitString = "Account: " + ownerItem.owner
              + "; Name: " + database[i].name
              + "; Backcarry: " + database[i].backcarry
              + "; Background: " + database[i].background
              + "; Clothes: " + database[i].clothes
              + "; Earrings: " + database[i].earrings
              + "; Eyebrows: " + database[i].eyebrows
              + "; Eyes: " + database[i].eyes
              + "; Eyewear: " + database[i].eyewear
              + "; Hair: " + database[i].hair
              + "; Headwear: " + database[i].headwear
              + "; Mouth: " + database[i].mouth
              + "; Necklace: " + database[i].necklace
              + "; Skin: " + database[i].skin

              // If the owner information was found, copy all the data from the database record
              // and copy in the fields we need from the owner record
              if (ownerItem) {
                merged.push({
                  ...database[i],
                  owner: ownerItem.owner,
                  unpackedRank: unpackedRank,
                  asset_id: ownerItem.asset_id,
                  traitString: traitString.toLowerCase(),
                })
              }
            }

            // Set the database equal to the merged results
            database = merged;
            merged = [];

            // Get the unique list of owners from the database
            const ownerAccounts = getUniqueArray(database, "owner");

            // Get the leaderboard stats and add the accounts to the autocomplete array
            for (let i = 0; i < ownerAccounts.length; i++) {
              autocompleteArray.push("Account: " + ownerAccounts[i]);

              let ownerCount = 0;
              let totalScore = 0;
              for (let j = 0; j < database.length; j++) {
                if (database[j].owner === ownerAccounts[i]) {
                  ownerCount += 1;
                  totalScore += database[j].TotalScore;
                }
              }

              leaderboardStats[i] = { owner: ownerAccounts[i], count: ownerCount, score: totalScore };
            }

            // Sort the leaderboard stats
            leaderboardStats.sort((a, b) => b.score - a.score);

            // Initialize the page now that all the data has been loaded.
            init();
          },
          error: function(res) {
            console.log( "Error! ", res );
            apiFailedAttempts += 1;

            if (apiFailedAttempts >= apiEndpoints.length) {
              // TODO: Add an error message for the user
            }
            else {
              // Increase the apiEnpointIndex and try again
              apiEndpointIndex += 1;

              if (apiEndpointIndex > apiEndpoints.length) {
                apiEndpointIndex = 0;
              }

              // Run this function again
              //console.log("Calling the function again");
              getOwners();
              //setInterval(getOwners);
            }
          }
        });
      }

      function getUniqueArray(array, key) {
        let uniqueSet = new Set();
        array.forEach(function(item) {
            if (item.hasOwnProperty(key)) {
                uniqueSet.add(item[key]);
            }
        });

        let result = Array.from(uniqueSet).sort((a, b) => a - b);
        return result;
      }

            if (hashArray[i][1] === "true") {
              $("#lewdierank-pool-checkbox").prop("checked", true);
              updatePoolSetting(true, false);
            }
            else {
              $("#lewdierank-pool-checkbox").prop("checked", false);
              updatePoolSetting(false, false);

          if (hashArray[i][0] === "search") {
            $("#lewdierank-search-textbox").val(hashArray[i][1]);
            $("#lewdierank-search-close-button").css("display", "block");

          if (hashArray[i][0] === "page") {

          }

        // Load the applicable page
        loadPage(pageName);
      }

      function performSearch() {
        const searchTerm = $("#lewdierank-search-textbox").val().trim().toLowerCase();
        const includePool = $('#lewdierank-pool-checkbox').is(':checked');

        // Close the autocomplete list
        var x = document.getElementsByClassName("lewdierank-search-autocomplete-items");
        for (var i = 0; i < x.length; i++) {
          x[i].parentNode.removeChild(x[i]);
        }

        // Add the search string to the hash
        if (searchTerm.length > 0) {
          setHash("search", searchTerm);
        }
        else {
          removeHash("search");
        }

        // Perform the search
        for (let i = 0; i < database.length; i++) {
          if (database[i].traitString.indexOf(searchTerm) >= 0 && (includePool || database[i].owner != poolAddress)) {
            $("#lewdierank-card-"+database[i].edition).show();
          }
          else {
            $("#lewdierank-card-"+database[i].edition).hide();
          }
        }
      }

      // Add custom styled AutoComplete to an input field
      // Credit: https://www.w3schools.com/howto/tryit.asp?filename=tryhow_js_autocomplete
      function autocomplete(inp, arr) {
        /*the autocomplete function takes two arguments,
        the text field element and an array of possible autocompleted values:*/
        var currentFocus;
        /*execute a function when someone writes in the text field:*/
        inp.addEventListener("input", function(e) {
            var a, b, i, val = this.value;
            /*close any already open lists of autocompleted values*/
            closeAllLists();
            if (!val) {
              $("#lewdierank-search-close-button").css("display", "none");
              return false;
            }
            $("#lewdierank-search-close-button").css("display", "block");
            currentFocus = -1;
            /*create a DIV element that will contain the items (values):*/
            a = document.createElement("DIV");
            a.setAttribute("id", this.id + "autocomplete-list");
            a.setAttribute("class", "lewdierank-search-autocomplete-items");
            /*append the DIV element as a child of the autocomplete container:*/
            this.parentNode.appendChild(a);
            /*for each item in the array...*/
            for (i = 0; i < arr.length; i++) {
              /*check if the item contains the same letters as the text field value:*/
              if (arr[i].toUpperCase() !== arr[i].toUpperCase().replace(val.toUpperCase())) {
                /*create a DIV element for each matching element:*/
                b = document.createElement("DIV");
                /*make the matching letters bold:*/
                let startc = arr[i].toUpperCase().indexOf(val.toUpperCase());
                let endc = startc + val.length;
                if (startc === 0) {
                  b.innerHTML = "<strong>" + arr[i].substr(0, val.length) + "</strong>";
                  b.innerHTML += arr[i].substr(val.length);
                }
                else {
                  b.innerHTML = arr[i].substr(0, startc);
                  b.innerHTML += "<strong>" + arr[i].substr(startc, val.length) + "</strong>";
                  b.innerHTML += arr[i].substr(endc);
                }
                /*insert a input field that will hold the current array item's value:*/
                b.innerHTML += "<input type='hidden' value='" + arr[i] + "'>";
                /*execute a function when someone clicks on the item value (DIV element):*/
                b.addEventListener("click", function(e) {
                    /*insert the value for the autocomplete text field:*/
                    inp.value = this.getElementsByTagName("input")[0].value;
                    /*close the list of autocompleted values,
                    (or any other open lists of autocompleted values:*/
                    closeAllLists();
                    performSearch();
                });
                a.appendChild(b);
              }
            }
        });
        /*execute a function presses a key on the keyboard:*/
        inp.addEventListener("keydown", function(e) {
            var x = document.getElementById(this.id + "autocomplete-list");
            if (x) x = x.getElementsByTagName("div");
            if (e.keyCode == 40) {
              /*If the arrow DOWN key is pressed,
              increase the currentFocus variable:*/
              currentFocus++;
              /*and and make the current item more visible:*/
              addActive(x);
            } else if (e.keyCode == 38) { //up
              /*If the arrow UP key is pressed,
              decrease the currentFocus variable:*/
              currentFocus--;
              /*and and make the current item more visible:*/
              addActive(x);
            } else if (e.keyCode == 13) {
              /*If the ENTER key is pressed, prevent the form from being submitted,*/
              e.preventDefault();
              if (currentFocus > -1) {
                /*and simulate a click on the "active" item:*/
                if (x) x[currentFocus].click();
              }
              performSearch();
            }
        });
        function addActive(x) {
          /*a function to classify an item as "active":*/
          if (!x) return false;
          /*start by removing the "active" class on all items:*/
          removeActive(x);
          if (currentFocus >= x.length) currentFocus = 0;
          if (currentFocus < 0) currentFocus = (x.length - 1);
          /*add class "autocomplete-active":*/
          x[currentFocus].classList.add("autocomplete-active");
        }
        function removeActive(x) {
          /*a function to remove the "active" class from all autocomplete items:*/
          for (var i = 0; i < x.length; i++) {
            x[i].classList.remove("autocomplete-active");
          }
        }
        function closeAllLists(elmnt) {
          /*close all autocomplete lists in the document,
          except the one passed as an argument:*/
          var x = document.getElementsByClassName("lewdierank-search-autocomplete-items");
          for (var i = 0; i < x.length; i++) {
            if (elmnt != x[i] && elmnt != inp) {
              x[i].parentNode.removeChild(x[i]);
            }
          }
        }
        /*execute a function when someone clicks in the document:*/
        document.addEventListener("click", function (e) {
            closeAllLists(e.target);

            if(getHashValue("page") === "lewdies" && $("#lewdierank-search-textbox").val().length > 0) {
              performSearch();
            }            
        });
      }
